import React from "react";
import { CurrencyDollarIcon } from "@heroicons/react/24/solid";

const AdminDashboard = () => {
  return (
    <div className="mt-[75px] px-4">
      <h1 className="text-3xl font-semibold py-4">
        Dashboard
      </h1>
      <div className="flex flex-row w-2/3">
        <div className="flex flex-col w-1/3 rounded-[4px] gap-4 border border-gray-400  overflow-hidden">
          <h4 className="font-semibold text-xl">
            Earnings
          </h4>
          <div className="flex flex-row justify-between">
            <h5 className="font-light">${}</h5>
            <CurrencyDollarIcon className="text-#A829E0"/>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
